import heapq
from typing import List

def k_closest(points: List[List[int]], k: int) -> List[List[int]]:
    queue = []

    for point in points:
        dist = point[0]**2 + point[1]**2
        heapq.heappush(queue, (-dist, point))

        if len(queue) > k:
            heapq.heappop(queue)

    return [point for dist, point in queue]
